(69, 1, '2024-05-16 17:21:25', '2024-05-16 14:21:25', 'Футболка трендового кроя сшита из материалов высокого качества и украшена оригинальным градиентным принтом.\r\nБлагодаря модели унисекс футболка подойдёт как мужчинам, так и женщинам, и эргономично впишется в любой гардероб.\r\nСтирать футболку рекомендуется с помощью мягких моющих средств в режиме ручной или деликатной стирки, а температура воды не должна превышать 30°C.\r\n\r\n95% хлопок 5% лайкра/кулирная гладь компакт пенье с энзимом 185 гр/м2/обработка горловины-рибана/закрытие горловины-киперная лента/силиконовая лента в плече', 'Футболка оверсайз Сбер', '', 'trash', 'open', 'closed', '', '__trashed', '', '', '2024-05-16 17:21:25', '2024-05-16 14:21:25', '', 0, 'http://localhost/?post_type=product&#038;p=69', 0, 'product', '', 0),
