(75, 1, '2024-05-16 17:20:13', '2024-05-16 14:20:13', 'Футболка трендового кроя сшита из материалов высокого качества и украшена оригинальным градиентным принтом.\r\nБлагодаря модели унисекс футболка подойдёт как мужчинам, так и женщинам, и эргономично впишется в любой гардероб.\r\nСтирать футболку рекомендуется с помощью мягких моющих средств в режиме ручной или деликатной стирки, а температура воды не должна превышать 30°C.\r\n\r\n95% хлопок 5% лайкра/кулирная гладь компакт пенье с энзимом 185 гр/м2/обработка горловины-рибана/закрытие горловины-киперная лента/силиконовая лента в плече', 'Футболка Градиент белый', '', 'publish', 'open', 'closed', '', '%d1%84%d1%83%d1%82%d0%b1%d0%be%d0%bb%d0%ba%d0%b0-%d0%be%d0%b2%d0%b5%d1%80%d1%81%d0%b0%d0%b9%d0%b7-%d1%81%d0%b1%d0%b5%d1%80', '', '', '2024-05-23 17:35:49', '2024-05-23 14:35:49', '', 0, 'http://localhost/?post_type=product&#038;p=75', 0, 'product', '', 0),
