(130, 1, '2024-05-16 18:13:49', '2024-05-16 15:13:49', 'Любимый СберКот стал ещё современнее и появился в новом формате!\r\n\r\nЛёгкий дышащий материал - хлопковая ткань с примесью лайкра - обеспечивает комфортное и приятное соприкосновение с кожей. Лонгслив подойдёт для самых активных – материал хорошо тянется и обладает высокой прочностью. Уникальная и практичная вещь будет кстати к любому случаю: свободная форма для школы или же отдых на природе. Лонгслив является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков. С коллекцией СБЕРКОТ вы сможете собрать стильный образ не ограничиваясь одеждой - различные предметы обихода выполнены в едином трендовом узоре «гусиная лапка»!\r\n\r\nСостав: 95% хлопок + 5% лайкра\r\nМатериал: кулирная гладь компакт пенье 185 гр\r\nОбработка горловины - рибана, закрытие горловины - киперная лента, силиконовая лента в плече', 'Лонгслив детский СБЕРКОТ', '', 'publish', 'open', 'closed', '', '%d0%bb%d0%be%d0%bd%d0%b3%d1%81%d0%bb%d0%b8%d0%b2-%d0%b4%d0%b5%d1%82%d1%81%d0%ba%d0%b8%d0%b9-%d1%81%d0%b1%d0%b5%d1%80%d0%ba%d0%be%d1%82', '', '', '2024-05-23 17:33:31', '2024-05-23 14:33:31', '', 0, 'http://localhost/?post_type=product&#038;p=130', 0, 'product', '', 0),
