(135, 1, '2024-05-16 18:16:36', '2024-05-16 15:16:36', 'Любимый СберКот стал ещё современнее и появился в новом формате!\r\n\r\nХлопковая ткань в смеси с полиэстером обеспечивает комфортное и приятное соприкосновение с кожей. Худи подойдёт для самых активных – материал обладает свойством минимальной деформации и высокой износоустойчивостью: цвет сохраняет свою насыщенность после частых стирок. Худи является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков. С коллекцией СБЕРКОТ вы сможете собрать стильный образ не ограничиваясь одеждой - различные предметы обихода выполнены в едином трендовом узоре «гусиная лапка»!\r\n\r\nМатериал: футер пенье 3х нитка петля 330 гр\r\nОбработка горловины - рибана,закрытие горловины - киперная лента, силиконовая лента в плече\r\nСостав: 65% хлопок + 35% полиэстер', 'Толстовка детская СБЕРКОТ белая', '', 'publish', 'open', 'closed', '', '%d1%82%d0%be%d0%bb%d1%81%d1%82%d0%be%d0%b2%d0%ba%d0%b0-%d0%b4%d0%b5%d1%82%d1%81%d0%ba%d0%b0%d1%8f-%d1%81%d0%b1%d0%b5%d1%80%d0%ba%d0%be%d1%82-%d0%b1%d0%b5%d0%bb%d0%b0%d1%8f', '', '', '2024-05-23 17:33:16', '2024-05-23 14:33:16', '', 0, 'http://localhost/?post_type=product&#038;p=135', 0, 'product', '', 0),
