(147, 1, '2024-05-16 18:31:09', '2024-05-16 15:31:09', 'Данная модель маломерит.\r\nРекомендуем выбирать на два размера больше.\r\n\r\nУльтралёгкая стёганая куртка – идеальное решение в демисезон: классическая модель и расширенная палитра – всё, что нужно, чтобы создать несколько новых образов, которые подойдут как для деловой встречи, так и для прогулки или путешествия.\r\n\r\nКуртка оснащена капюшоном, двумя карманами и надёжной молнией.\r\nБлагодаря высокой износоустойчивости материалов эта куртка надолго станет частью вашей коллекции образов.\r\n\r\nХранить эту куртку так же удобно, как и носить: она легко складывается в специальный мешочек и не занимает много места.\r\n\r\nВнешний слой: 100% полиестер/экоутеплитель 180 гр/м2/стеганная куртка с капюшоном и двумя карманами\r\nБрендирование: вышитый ESG шеврон, принты внутри', 'Куртка СБЕР черная', '', 'publish', 'open', 'closed', '', '%d1%81%d1%82%d0%b5%d0%b3%d0%b0%d0%bd%d0%b0%d1%8f-%d0%ba%d1%83%d1%80%d1%82%d0%ba%d0%b0-%d1%81%d0%b1%d0%b5%d1%80-%d1%81-%d0%ba%d0%b0%d0%bf%d1%8e%d1%88%d0%be%d0%bd%d0%be%d0%bc-%d1%87%d0%b5%d1%80%d0%bd', '', '', '2024-05-23 17:32:48', '2024-05-23 14:32:48', '', 0, 'http://localhost/?post_type=product&#038;p=147', 0, 'product', '', 0),
