(159, 1, '2024-05-16 18:37:37', '2024-05-16 15:37:37', 'Sber AI совместно с Kandinsky разработали яркую и уникальную коллекцию одежды.\r\nКлассические модели украшены принтами со сказочными животными, созданными ИИ.\r\nИскусственный интеллект, согласно запросу, генерирует уникальные изображения – идентичных или похожих принтов найти в масс-маркете не удастся.\r\nФутболка бережно сшита из высококачественных материалов, а принт долговечен и не боится многократных стирок. Стирать футболку рекомендуется с помощью мягких моющих средств в режиме ручной или деликатной стирки, а температура воды не должна превышать 60°C.\r\n\r\n95% хлопок 5% лайкра', 'Футболка оверсайз Sber AI Леопард', '', 'publish', 'open', 'closed', '', '%d1%84%d1%83%d1%82%d0%b1%d0%be%d0%bb%d0%ba%d0%b0-%d0%be%d0%b2%d0%b5%d1%80%d1%81%d0%b0%d0%b9%d0%b7-sber-ai-%d0%bb%d0%b5%d0%be%d0%bf%d0%b0%d1%80%d0%b4', '', '', '2024-05-23 17:32:17', '2024-05-23 14:32:17', '', 0, 'http://localhost/?post_type=product&#038;p=159', 0, 'product', '', 0),
