(171, 1, '2024-05-16 18:40:48', '2024-05-16 15:40:48', 'Sber AI совместно с Kandinsky разработали яркую и уникальную коллекцию одежды.\r\nКлассические модели украшены принтами со сказочными животными, созданными ИИ.\r\nИскусственный интеллект, согласно запросу, генерирует уникальные изображения – идентичных или похожих принтов найти в масс-маркете не удастся.\r\nТолстовка бережно сшита из 100% хлопка, а принт долговечен и не боится многократных стирок. Стирать толстовку рекомендуется с помощью мягких моющих средств в режиме ручной или деликатной стирки, а температура воды не должна превышать 60°C.\r\n\r\nМатериал: футер без начёса, 260 г/м², 100% хлопок\r\nНанесение: DTF до 500 см2 на груди', 'Толстовка Панда небесная', '', 'publish', 'open', 'closed', '', '%d1%82%d0%be%d0%bb%d1%81%d1%82%d0%be%d0%b2%d0%ba%d0%b0-%d0%bf%d0%b0%d0%bd%d0%b4%d0%b0-%d0%bd%d0%b5%d0%b1%d0%b5%d1%81%d0%bd%d0%b0%d1%8f', '', '', '2024-05-23 17:31:51', '2024-05-23 14:31:51', '', 0, 'http://localhost/?post_type=product&#038;p=171', 0, 'product', '', 0),
