(175, 1, '2024-05-16 18:44:23', '2024-05-16 15:44:23', 'Худи в классическом чёрном цвете с капюшоном и оригинальным принтом бережно сшит из высококачественных материалов.\r\nБлагодаря плотной ткани (260 г/м2) и капюшону мягкий и приятный на ощупь худи точно не даст замёрзнуть на долгой вечерней прогулке или под офисным кондиционером. Модель унисекс подходит как мужчинам, так и женщинам.\r\n\r\nМатериал: футер, 60% хлопок, 40% полиэстер\r\nПлотность: 260 гр/м2\r\nМодель: унисекс\r\nЦвет: черный\r\nНанесение: термотрансфер/ДТФ', 'Худи СберТех XII', '', 'publish', 'open', 'closed', '', '%d1%85%d1%83%d0%b4%d0%b8-%d1%81%d0%b1%d0%b5%d1%80%d1%82%d0%b5%d1%85-xii', '', '', '2024-05-23 17:31:39', '2024-05-23 14:31:39', '', 0, 'http://localhost/?post_type=product&#038;p=175', 0, 'product', '', 0),
