(187, 1, '2024-05-16 18:55:06', '2024-05-16 15:55:06', 'Толстовка из коллекции «Градиент» от СБЕР бережно сшита из высококачественных материалов и украшена градиентным принтом.\r\n\r\nПлотная ткань (330 г/м2) износоустойчива, а принт не боится многократных стирок: толстовку достаточно стирать с помощью мягких моющих средств в режиме ручной или деликатной стирки при температуре не выше 60°C, однако количество оборотов отжима не должно превышать 600 об/минуту.\r\n\r\nУниверсальная толстовка с оригинальным принтом не даст замёрзнуть на прогулке или под офисным кондиционером, а благодаря модели унисекс отлично подойдёт как мужчинам, так и женщинам\r\n\r\n65% хлопок 35% полиэстер/ футер пенье 3 х нитка петля 330 гр/м2/ 30/70/10, обработка горловины-рибана/закрытие горловины-киперная лента/силиконовая лента в плече', 'Толстовка Градиент зеленый', '', 'publish', 'open', 'closed', '', '%d1%82%d0%be%d0%bb%d1%81%d1%82%d0%be%d0%b2%d0%ba%d0%b0-%d0%b3%d1%80%d0%b0%d0%b4%d0%b8%d0%b5%d0%bd%d1%82-%d0%b7%d0%b5%d0%bb%d0%b5%d0%bd%d1%8b%d0%b9', '', '', '2024-05-23 17:31:09', '2024-05-23 14:31:09', '', 0, 'http://localhost/?post_type=product&#038;p=187', 0, 'product', '', 0),
