(194, 1, '2024-05-16 18:56:40', '2024-05-16 15:56:40', 'Будь ярче с линейкой фирменной одежды Градиент для всей семьи!\r\n\r\nДетский худи коллекции градиент поможет вам подчеркнуть индивидуальность и яркость вашего ребёнка. Хлопковая ткань в смеси с полиэстером обеспечивает комфортное и приятное соприкосновение с кожей. Эстетичный вид худи придают ровные швы и контрастные белые детали, а мягкие переходы зелёного, жёлтого и голубого в дизайне создают приятное для глаза сочетание. Худи подойдёт для самых активных – материал обладает свойством минимальной деформации и высокой износоустойчивости: цвет сохраняет свою насыщенность после частых стирок. Худи является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков.\r\n\r\nНа моделях представлен размер 122\r\nМатериал: Футер 3х ниточный петля, 320 гр\r\nСостав: 65% хлопок + 35% полиэстер', 'Худи детский Градиент зеленый', '', 'publish', 'open', 'closed', '', '%d1%85%d1%83%d0%b4%d0%b8-%d0%b4%d0%b5%d1%82%d1%81%d0%ba%d0%b8%d0%b9-%d0%b3%d1%80%d0%b0%d0%b4%d0%b8%d0%b5%d0%bd%d1%82-%d0%b7%d0%b5%d0%bb%d0%b5%d0%bd%d1%8b%d0%b9', '', '', '2024-05-23 17:31:02', '2024-05-23 14:31:02', '', 0, 'http://localhost/?post_type=product&#038;p=194', 0, 'product', '', 0),
