(206, 1, '2024-05-16 19:00:24', '2024-05-16 16:00:24', 'Будь ярче с линейкой фирменной одежды Градиент для всей семьи!\r\n\r\nДетская футболка коллекции градиент поможет вам подчеркнуть индивидуальность и яркость вашего ребёнка. Лёгкий дышащий материал - хлопковая ткань с примесью эластана - обеспечивает комфортное и приятное соприкосновение с кожей. Эстетичный вид футболке придают ровные швы и контрастные белые детали, а небольшая часть мягких переходов зелёного, жёлтого и голубого на крае создают приятное для глаза сочетание. Благодаря такому дизайну изделие остаётся классическим, имея при этом интересную изюминку. Футболка подойдёт для самых активных – материал хорошо тянется и обладает высокой прочностью. Футболка является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков.\r\n\r\nНа моделях представлен размер 122\r\nМатериал: Кулирная гладь компакт/пенье\r\nСостав: 95% хлопок + 5% эластан, 185 гр', 'Футболка детская Градиент белый', '', 'publish', 'open', 'closed', '', '%d1%84%d1%83%d1%82%d0%b1%d0%be%d0%bb%d0%ba%d0%b0-%d0%b4%d0%b5%d1%82%d1%81%d0%ba%d0%b0%d1%8f-%d0%b3%d1%80%d0%b0%d0%b4%d0%b8%d0%b5%d0%bd%d1%82-%d0%b1%d0%b5%d0%bb%d1%8b%d0%b9', '', '', '2024-05-23 17:30:15', '2024-05-23 14:30:15', '', 0, 'http://localhost/?post_type=product&#038;p=206', 0, 'product', '', 0),
