(212, 1, '2024-05-16 19:02:37', '2024-05-16 16:02:37', 'Специально разработанная коллекция в честь 5-летия СберКота!\r\n\r\nТеперь вы сможете использовать популярные стикеры СберКота в реальной жизни. Трендовый крой оверсайз обеспечит свободу в использовании, а хлопковая ткань с примесью полиэстера обладает высокой износоустойчивостью: частые стирки и длительная эксплуатация не влияют на качество изделия. При этом худи является унисекс-изделием – это значит, что она отлично подойдет как для женщин, так и для мужчин. В новой коллекции СберКота вы сможете подобрать себе одежду под любое настроение!\r\n\r\nМатериал: Футер пенье 3 х нитка петля 330 гр.м2, обработка горловины – рибана, закрытие горловины - киперная лента, силиконовая лента в плече\r\nСостав: 65% хлопок + 35% полиэстер', 'Худи Кто такой СберКот?', '', 'publish', 'open', 'closed', '', '%d1%85%d1%83%d0%b4%d0%b8-%d0%ba%d1%82%d0%be-%d1%82%d0%b0%d0%ba%d0%be%d0%b9-%d1%81%d0%b1%d0%b5%d1%80%d0%ba%d0%be%d1%82', '', '', '2024-05-23 17:29:35', '2024-05-23 14:29:35', '', 0, 'http://localhost/?post_type=product&#038;p=212', 0, 'product', '', 0),
