(255, 1, '2024-05-23 17:30:21', '2024-05-23 14:30:21', 'Будь ярче с линейкой фирменной одежды Градиент для всей семьи!\n\nДетская футболка коллекции градиент поможет вам подчеркнуть индивидуальность и яркость вашего ребёнка. Лёгкий дышащий материал - хлопковая ткань с примесью эластана - обеспечивает комфортное и приятное соприкосновение с кожей. Эстетичный вид футболке придают ровные швы и контрастные белые детали, а небольшая часть мягких переходов зелёного, жёлтого и голубого на крае создают приятное для глаза сочетание. Благодаря такому дизайну изделие остаётся классическим, имея при этом интересную изюминку. Футболка подойдёт для самых активных – материал хорошо тянется и обладает высокой прочностью. Футболка является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков.\n\nНа моделях представлен размер 122\nМатериал: Кулирная гладь компакт/пенье\nСостав: 95% хлопок + 5% эластан, 185 гр', 'Футболка детская Градиент белый', '', 'inherit', 'closed', 'closed', '', '206-autosave-v1', '', '', '2024-05-23 17:30:21', '2024-05-23 14:30:21', '', 206, 'http://localhost/?p=255', 0, 'revision', '', 0),
(256, 1, '2024-05-23 17:30:46', '2024-05-23 14:30:46', 'Будь ярче с линейкой фирменной одежды Градиент для всей семьи!\n\nДетский свитшот коллекции градиент поможет вам подчеркнуть индивидуальность и яркость вашего ребёнка. Хлопковая ткань в смеси с полиэстером обеспечивает комфортное и приятное соприкосновение с кожей. Эстетичный вид свитшоту придают ровные швы и контрастные белые детали, а мягкие переходы зелёного, жёлтого и голубого в дизайне создают приятное для глаза сочетание. Свитшот подойдёт для самых активных – материал хорошо тянется и обладает высокой износоустойчивостью: цвет сохраняет свою насыщенность после частых стирок. Свитшот является унисекс-изделием — это значит, что она отлично подойдёт как для девочек, так и для мальчиков.\n\nНа моделях представлен размер 122\nМатериал: Футер 3х ниточный петля, 320 гр\nСостав: 65% хлопок + 35% полиэстер', 'Свитшот детский Градиент зеленый', '', 'inherit', 'closed', 'closed', '', '200-autosave-v1', '', '', '2024-05-23 17:30:46', '2024-05-23 14:30:46', '', 200, 'http://localhost/?p=256', 0, 'revision', '', 0),
(257, 1, '2024-05-23 17:31:21', '2024-05-23 14:31:21', 'Толстовка из коллекции «Градиент» от СБЕР бережно сшита из высококачественных материалов и украшена градиентным принтом.\n\nПлотная ткань (330 г/м2) износоустойчива, а принт не боится многократных стирок: толстовку достаточно стирать с помощью мягких моющих средств в режиме ручной или деликатной стирки при температуре не выше 60°C, однако количество оборотов отжима не должно превышать 600 об/минуту.\n\nУниверсальная толстовка с оригинальным принтом не даст замёрзнуть на прогулке или под офисным кондиционером, а благодаря модели унисекс отлично подойдёт как мужчинам, так и женщинам\n\n65% хлопок 35% полиэстер/ футер пенье 3 х нитка петля 330 гр/м2/ 30/70/10, обработка горловины-рибана/закрытие горловины-киперная лента/силиконовая лента в плече', 'Толстовка Градиент зеленый', '', 'inherit', 'closed', 'closed', '', '187-autosave-v1', '', '', '2024-05-23 17:31:21', '2024-05-23 14:31:21', '', 187, 'http://localhost/?p=257', 0, 'revision', '', 0),
(258, 1, '2024-05-23 17:31:25', '2024-05-23 14:31:25', 'Футболка в классическом чёрном цвете с оригинальным ненавязчивым принтом бережно сшита из 100% хлопка.\nТакая футболка станет достойным дополнением вашему гардеробу, а базовая модель унисекс подходит как мужчинам, так и женщинам.\n\n\n\nМатериал: кулирная гладь, 100% хлопок\nПлотность 140-145 гр/м2\nМодель: унисекс\nЦвет: черный\nНанесение: термотрансфер/ДТФ', 'Футболка СберТех XII', '', 'inherit', 'closed', 'closed', '', '181-autosave-v1', '', '', '2024-05-23 17:31:25', '2024-05-23 14:31:25', '', 181, 'http://localhost/?p=258', 0, 'revision', '', 0),
(259, 1, '2024-05-23 17:31:32', '2024-05-23 14:31:32', 'Худи в классическом чёрном цвете с капюшоном и оригинальным принтом бережно сшит из высококачественных материалов.\nБлагодаря плотной ткани (260 г/м2) и капюшону мягкий и приятный на ощупь худи точно не даст замёрзнуть на долгой вечерней прогулке или под офисным кондиционером. Модель унисекс подходит как мужчинам, так и женщинам.\n\n\nМатериал: футер, 60% хлопок, 40% полиэстер\nПлотность: 260 гр/м2\nМодель: унисекс\nЦвет: черный\nНанесение: термотрансфер/ДТФ', 'Худи СберТех XII', '', 'inherit', 'closed', 'closed', '', '175-autosave-v1', '', '', '2024-05-23 17:31:32', '2024-05-23 14:31:32', '', 175, 'http://localhost/?p=259', 0, 'revision', '', 0),
(260, 1, '2024-05-23 17:32:12', '2024-05-23 14:32:12', 'Sber AI совместно с Kandinsky разработали яркую и уникальную коллекцию одежды.\nКлассические модели украшены принтами со сказочными животными, созданными ИИ.\nИскусственный интеллект, согласно запросу, генерирует уникальные изображения – идентичных или похожих принтов найти в масс-маркете не удастся.\nФутболка бережно сшита из высококачественных материалов, а принт долговечен и не боится многократных стирок. Стирать футболку рекомендуется с помощью мягких моющих средств в режиме ручной или деликатной стирки, а температура воды не должна превышать 60°C.\n\n\n95% хлопок 5% лайкра', 'Футболка оверсайз Sber AI Леопард', '', 'inherit', 'closed', 'closed', '', '159-autosave-v1', '', '', '2024-05-23 17:32:12', '2024-05-23 14:32:12', '', 159, 'http://localhost/?p=260', 0, 'revision', '', 0),
(261, 1, '2024-05-23 17:32:38', '2024-05-23 14:32:38', 'Данная модель маломерит.\nРекомендуем выбирать на два размера больше.\n\nУльтралёгкая стёганая куртка – идеальное решение в демисезон: классическая модель и расширенная палитра – всё, что нужно, чтобы создать несколько новых образов, которые подойдут как для деловой встречи, так и для прогулки или путешествия.\n\nКуртка оснащена капюшоном, двумя карманами и надёжной молнией.\nБлагодаря высокой износоустойчивости материалов эта куртка надолго станет частью вашей коллекции образов.\n\nХранить эту куртку так же удобно, как и носить: она легко складывается в специальный мешочек и не занимает много места.\n\nВнешний слой: 100% полиестер/экоутеплитель 180 гр/м2/стеганная куртка с капюшоном и двумя карманами\nБрендирование: вышитый ESG шеврон, принты внутри', 'Куртка СБЕР бежевая', '', 'inherit', 'closed', 'closed', '', '153-autosave-v1', '', '', '2024-05-23 17:32:38', '2024-05-23 14:32:38', '', 153, 'http://localhost/?p=261', 0, 'revision', '', 0),
(263, 1, '2024-05-23 17:32:49', '2024-05-23 14:32:49', '65% хлопок 35% полиэстер/ футер пенье 3 х нитка петля 330 гр/м2/ 30/70/10,закрытие горловины-киперная лента/подкладка капюшона/силиконовая лента в плече.', 'Худи детский Сберкот NEW Поцелуй', '', 'inherit', 'closed', 'closed', '', '141-autosave-v1', '', '', '2024-05-23 17:32:49', '2024-05-23 14:32:49', '', 141, 'http://localhost/?p=263', 0, 'revision', '', 0),
(264, 1, '2024-05-23 17:33:45', '2024-05-23 14:33:45', 'Толстовка оверсайз со СберКотом в новом 3D-облике!\nТолстовка сшита из материалов премиального качества – мягкая и приятная на ощупь, а благодаря трендовому крою – впишется в любой гардероб и освежит множество ваших луков.\n\nМатериал: футер 3-х нитка\nСостав: 80% хлопок, 20% полиэстер, плотность 350 г/м²\nНанесение: DTF (на груди)', 'Толстовка Сберкот NEW черный', '', 'inherit', 'closed', 'closed', '', '124-autosave-v1', '', '', '2024-05-23 17:33:45', '2024-05-23 14:33:45', '', 124, 'http://localhost/?p=264', 0, 'revision', '', 0),
