(266, 1, '2024-05-23 17:34:06', '2024-05-23 14:34:06', 'Худи оверсайз со СберКотом в новом 3D-облике!\nУютный худи трендового кроя сшит из материалов премиального качества, а благодаря трендовому крою – впишется в любой гардероб и освежит множество ваших луков.\n\nМатериал: футер 3-х нитка\nСостав: 65% хлопок, 35% полиэстр, плотность 350 г/м²\nНанесение: DTF (на груди)', 'Худи Сберкот NEW темно-синий', '', 'inherit', 'closed', 'closed', '', '112-autosave-v1', '', '', '2024-05-23 17:34:06', '2024-05-23 14:34:06', '', 112, 'http://localhost/?p=266', 0, 'revision', '', 0),
(267, 1, '2024-05-23 17:35:21', '2024-05-23 14:35:21', 'Будь ярче с линейкой фирменной одежды Градиент!\n\nСвитшот коллекции градиент поможет вам разнообразить ваш гардероб яркими цветами. Хлопковая ткань в смеси с полиэстером обеспечивает комфортное и приятное соприкосновение с кожей. Свитшот обладает высокой износоустойчивостью: частые стирки и длительная эксплуатация не влияют на качество изделия, а цвет сохраняет свою насыщенность. Эстетичный вид свитшоту придаёт свойство минимальной деформации и усадки, ровные швы и контрастные белые детали, а небольшая часть мягких переходов зелёного, жёлтого и голубого на крае создают приятное для глаза сочетание. Благодаря такому дизайну изделие остаётся классическим, имея при этом интересную изюминку. Свитшот является унисекс-изделием — это значит, что он отлично подойдёт как для женщин, так и для мужчин.\n\nНа моделях представлен размер 44 и 50\nМатериал: Футер 3х ниточный петля\nСостав: 65% хлопок + 35% полиэстер, 320 гр', 'Свитшот Градиент белый', '', 'inherit', 'closed', 'closed', '', '92-autosave-v1', '', '', '2024-05-23 17:35:21', '2024-05-23 14:35:21', '', 92, 'http://localhost/?p=267', 0, 'revision', '', 0),
