mentor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>							<figure>\n											<a href=\"http://localhost/product-category/градиент/?customize_changeset_uuid=c2417f85-0f55-47a2-9306-f423bc15b50e\">\n							<img src=\"http://localhost/wp-content/uploads/elementor/thumbs/22-qo90at0qjtgk6lqo9i8xtjfjv82odhcwgbeyehba9k.png\" title=\"22\" alt=\"22\" loading=\"lazy\" />								</a>\n											<figcaption>Градиент</figcaption>\n										</figure>\n										<figure>\n											<a href=\"http://localhost/product-category/сберкот/?customize_changeset_uuid=c2417f85-0f55-47a2-9306-f423bc15b50e\">\n							<img src=\"http://localhost/wp-content/uploads/elementor/thumbs/ь1-qo93yblssbhumgpfausr6uoc11uicwgvj9fop8b9o8.jpg\" title=\"ь1\" alt=\"ь1\" loading=\"lazy\" />								</a>\n											<figcaption>СберКот</figcaption>\n										</figure>\n										<figure>\n											<a href=\"http://localhost/product-category/детям/?customize_changeset_uuid=c2417f85-0f55-47a2-9306-f423bc15b50e\">\n							<img src=\"http://localhost/wp-content/uploads/elementor/thumbs/с4-qo93s6pq693gu3ma4pbfewf0fi39413ycw4kx7esag.jpg\" title=\"с4\" alt=\"с4\" loading=\"lazy\" />								</a>\n											<figcaption>Детям</figcaption>\n										</figure>\n										<figure>\n											<a href=\"http://localhost/product-category/сбер-ai/?customize_changeset_uuid=c2417f85-0f55-47a2-9306-f423bc15b50e\">\n							<img src=\"http://localhost/wp-content/uploads/elementor/thumbs/п1-qo9303bdwimxtofe6k4uvzn18wkb1pkrtu64jh2e9k.jpeg\" title=\"п1\" alt=\"п1\" loading=\"lazy\" />								</a>\n											<figcaption>Сбер AI</figcaption>\n										</figure>\n													<img width=\"640\" height=\"800\" src=\"http://localhost/wp-content/uploads/2024/05/23.png\" alt=\"\" srcset=\"http://localhost/wp-content/uploads/2024/05/23.png 800w, http://localhost/wp-content/uploads/2024/05/23-240x300.png 240w, http://localhost/wp-content/uploads/2024/05/23-768x960.png 768w, http://localhost/wp-content/uploads/2024/05/23-600x750.png 600w\" sizes=\"(max-width: 640px) 100vw, 640px\" />													\n		<h3>Будь ярче с линейкой фирменной одежды Градиент!</h3><p>Худи коллекции градиент поможет вам разнообразить ваш гардероб яркими цветами. Хлопковая ткань в смеси с полиэстером обеспечивает комфортное и приятное соприкосновение с кожей. Худи обладает высокой износоустойчивостью: частые стирки и длительная эксплуатация не влияют на качество изделия, а цвет сохраняет свою насыщенность. Эстетичный вид худи придаёт свойство минимальной деформации и усадки, ровные швы и контрастные белые детали, а мягкие переходы зелёного, жёлтого и голубого в дизайне создают приятное для глаза сочетание.</p><h3>Толстовка оверсайз со СберКотом в новом 3D-облике!</h3><p>Эта толстовка с изображением СберКота в новом 3D-облике сшита из материалов премиального качества, что делает её невероятно мягкой и приятной на ощупь. Благодаря трендовому крою, она идеально впишется в любой гардероб, добавив свежести и оригинальности множеству ваших повседневных и стильных луков. Независимо от того, предпочитаете ли вы спортивный или кэжуал стиль, эта толстовка станет незаменимым элементом вашего образа, подчеркивая вашу индивидуальность и чувство моды.</p>		\n													<img width=\"640\" height=\"800\" src=\"http://localhost/wp-content/uploads/2024/05/у1.jpg\" alt=\"\" srcset=\"http://localhost/wp-content/uploads/2024/05/у1.jpg 800w, http://localhost/wp-content/uploads/2024/05/у1-240x300.jpg 240w, http://localhost/wp-content/uploads/2024/05/у1-768x960.jpg 768w, http://localhost/wp-content/uploads/2024/05/у1-600x750.jpg 600w\" sizes=\"(max-width: 640px) 100vw, 640px\" />													\n													<img width=\"640\" height=\"800\" src=\"http://localhost/wp-content/uploads/2024/05/ы5.jpg\" alt=\"\" srcset=\"http://localhost/wp-content/uploads/2024/05/ы5.jpg 800w, http://localhost/wp-content/uploads/2024/05/ы5-240x300.jpg 240w, http://localhost/wp-content/uploads/2024/05/ы5-768x960.jpg 768w, http://localhost/wp-content/uploads/2024/05/ы5-600x750.jpg 600w\" sizes=\"(max-width: 640px) 100vw, 640px\" />													\n		<h3>Sber AI совместно с Kandinsky разработали яркую и уникальную коллекцию одежды.</h3><p>Классические модели украшены принтами со сказочными животными, созданными ИИ. Эти принты, вдохновленные волшебными существами, придают одежде неповторимый и сказочный вид, который привлекает внимание и вызывает восхищение. Искусственный интеллект, согласно запросу, генерирует уникальные изображения – идентичных или похожих принтов найти в масс-маркете не удастся. Каждый принт является эксклюзивным и неповторимым, что делает каждую вещь в коллекции по-настоящему уникальной. Футболка бережно сшита из высококачественных материалов, таких как органический хлопок и эластичные волокна, что обеспечивает комфорт и долговечность. </p>', 'Главная', '', 'inherit', 'closed', 'closed', '', '220-revision-v1', '', '', '2024-05-23 21:06:02', '2024-05-23 18:06:02', '', 220, 'http://localhost/?p=271', 0, 'revision', '', 0);
