(42, 'woopay-beta-merchantrecruitment-short-update-09MAY23', 'info', 'en_US', 'Increase conversions with WooPay — our fastest checkout yet', 'Be one of the first to try WooPay, our new express checkout feature. <br>Boost conversions by letting customers pay with a single click. <br><br>Update to the latest version of WooCommerce Payments to get started.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(43, 'woocommerce-WCSubscriptions-June-2023-updated-needed', 'marketing', 'en_US', 'Action required: Security update of WooCommerce Subscriptions', '<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(44, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(45, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(46, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(47, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(48, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(49, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(50, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(51, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(52, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(53, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'unactioned', 'woocommerce.com', '2024-05-16 14:55:55', NULL, 0, 'plain', '', 0, 0, 'info'),
(54, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(55, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(56, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'remove_estimated_deposits_2024', 'marketing', 'en_US', 'Estimated deposits are going away', 'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'checkout_survey_new_users', 'survey', 'en_US', 'We\'d like your feedback on WooCommerce checkout', 'Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(59, 'checkout_survey_new_users_no_orders', 'survey', 'en_US', 'We\'d like your feedback on WooCommerce checkout', 'Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.', '{}', 'unactioned', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'woocommerce-payfast-may-2024-update-needed', 'update', 'en_US', 'An important update is required for the Payfast Payment Gateway', '<strong>Please update to the latest version of the Payfast Payment Gateway for WooCommerce immediately to address a security vulnerability</strong>. This update is required to ensure that your transactions continue to process.', '{}', 'pending', 'woocommerce.com', '2024-05-15 17:48:53', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Подключиться к WooCommerce.com', 'Подключайтесь, чтобы получать важные уведомления о товаре и обновления.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-15 17:48:55', NULL, 0, 'plain', '', 0, 0, 'info'),
(62, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Выбираете тему?', 'Узнайте, какие темы совместимы с WooCommerce и выберите ту, что лучше подойдёт под стиль и требования вашего бизнеса.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-16 17:53:37', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Как настроить каталог товаров', 'Вы хотите, чтобы ваш каталог товаров с изображениями выглядели великолепно и соответствовали вашему бренду. Это руководство даст вам все необходимые советы, чтобы ваши товары отлично смотрелись в вашем магазине.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-18 16:20:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-18 16:20:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Начните принимать платежи в своем магазине!', 'Принимайте платежи в удобной для вас системе — вам доступны более 100 платежных шлюзов для WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-23 13:30:25', NULL, 0, 'plain', '', 0, 0, 'info'),
(66, 'wc-admin-woocommerce-payments', 'marketing', 'en_US', 'Попробуйте новый способ приёма платежей', 'Безопасно принимайте кредитные и дебетовые карты на своем сайте. Управляйте транзакциями, не выходя из панели управления WordPress. Только с <strong>WooPayments</strong>.<br><br>Нажимая кнопку «Приступить», вы соглашаетесь с нашими <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Условиями предоставления услуг</a>', '{}', 'unactioned', 'woocommerce-admin', '2024-05-23 13:30:26', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-update-db-reminder', 'update', 'en_US', 'Обновление базы данных WooCommerce завершено', 'Обновление данных WooCommerce завершено. Спасибо вам за обновление до последней версии!', '{}', 'actioned', 'woocommerce-core', '2024-05-23 14:07:02', NULL, 0, 'plain', '', 0, 1, 'info'),
(68, 'wc-admin-launch-checklist', 'info', 'en_US', 'Готовы запустить собственный магазин?', 'Чтобы у вас не возникало чувство, что вы что-то забыли, мы составили контрольный список для проверки настроек перед запуском.', '{}', 'unactioned', 'woocommerce-admin', '2024-05-23 18:05:32', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-payments-notes-set-https-for-checkout', 'info', 'en_US', 'Enable secure checkout', 'Enable HTTPS on your checkout pages to display all available payment methods and protect your customers data.', '{}', 'unactioned', 'woocommerce-payments', '2024-05-24 15:03:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'wc-admin-orders-milestone', 'info', 'en_US', 'Получен первый заказ', 'Поздравляем с получением первого заказа! Самое время узнать, как управлять этими заказами.', '{\"current_milestone\":1}', 'unactioned', 'woocommerce-admin', '2024-05-24 15:48:51', NULL, 0, 'plain', '', 0, 0, 'info');
